def nonsingular(vmin, vmax, expander=0.001, tiny=1e-15, increasing=True):
    if (not np.isfinite(vmin)) or (not np.isfinite(vmax)):
        return -expander, expander  # Return the expander values if input is inf or NaN

    if vmax < vmin:
        vmin, vmax = vmax, vmin  # Swap vmin and vmax if necessary

    maxabsvalue = max(abs(vmin), abs(vmax))
    # Adjust vmin and vmax based on the comparison with tiny
    if (vmax - vmin <= maxabsvalue * tiny) or (np.isinf(maxabsvalue) and np.isfinite(vmin) and np.isfinite(vmax)):
        if vmax == 0 and vmin == 0:
            return -expander, expander  # Return the expander values if both inputs are very close to zero
        else:
            vmin -= expander * np.abs(vmin)
            vmax += expander * np.abs(vmax)

    if not increasing:
        vmin, vmax = min(vmin, vmax), max(vmin, vmax)  # Swap vmin and vmax if necessary

    return vmin, vmax
